#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int maxProduct(vector<int>& nums) {
      int max_product = nums[0];
      int product = nums[0];
      int product_with_negative = 0;
      int n = nums.size();
      for (auto i = 1; i < n; ++i) {
	if (product == 0) {
	  product = 1;
	  product_with_negative = 0;
	} else if (product < 0 && product_with_negative == 0) {
	  product_with_negative = product;
	  product = 1;
	}
	product *= nums[i];
	product_with_negative *= nums[i];
	if (product > max_product)
	  max_product = product;
	if (product_with_negative > max_product)
	  max_product = product_with_negative;
      }
      return max_product;
    }
};

